import React, { Component } from "react";
import { MDBTable, MDBTableBody, MDBTableHead } from "mdbreact";

import antiStaticBags from "./product-data/bags/antiStaticBags";
console.log(antiStaticBags);

class App extends Component {
	state = {
		antiStaticBags: antiStaticBags
	};
	render() {
		const items = this.state.antiStaticBags.map((item, key) => (
			<td key={item.productNumber}>
				{item.durability},{item.bagPerCase},{item.bagPerCase},{item.sizeWxL},
				{item.weight}
			</td>
		));

		return (
			<MDBTable striped>
				<MDBTableHead>
					<tr>
						<th>Product Number</th>
						<th>Durability</th>
						<th>Size</th>
						<th>Weight</th>
						<th>Bags Per Case</th>
					</tr>
				</MDBTableHead>
				<MDBTableBody>
					<tr>
						<td>{items.productNumber}</td>
						<td>{items.durability}</td>
						<td>{items.sizeWxL}</td>
						<td>{items.weight}</td>
						<td>{items.bagPerCase}</td>
					</tr>
				</MDBTableBody>
			</MDBTable>
		);
	}
}

export default App;
